O nível de risco da sua Carteira Magnetis é pensado para contemplar seu atual momento de vida e o melhor caminho para alcançar suas metas.
Ele já considera os efeitos do sobe e desce do mercado ao longo da sua jornada. Além disso, também monitoramos constantemente o limite dessas oscilações para que elas fiquem sempre dentro do limite tolerado pelo seu perfil. Esse aliás, é um dos principais diferenciais do nosso serviço.
Dessa forma, recomendamos que você não faça nenhuma alteração, a menos que mude de objetivos ou de condição financeira.  
Seu nível de risco é definido no momento em que você faz a sua primeira simulação de investimento conosco e descobre o seu perfil. A partir daí, a carteira indicada para você pode ser uma das listadas a seguir:

Carteira Magnetis 1: indicada para quem quer sair da poupança ou deseja um retorno mais previsível em suas aplicações financeiras. Ela é composta por uma ampla seleção de fundos de renda fixa investidos através do Magnetis Renda Fixa, Magnetis Debêntures Incentivadas e Magnetis Renda Fixa Simples;
Carteira Magnetis 2: é a opção para quem deseja aumentar sua rentabilidade sem abrir mão da previsibilidade da renda fixa. Ela é composta por cotas de fundos de renda fixa, além de uma pequena parcela em fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos;
Carteira Magnetis 3: é indicada para quem quer investir a partir de 2 anos, buscando mais rentabilidade. Ela tem uma composição balanceada em fundos de renda fixa, fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos;
Carteira Magnetis 4: é uma alternativa interessante para quem quer investir na bolsa de valores com diversificação, sem ter de se preocupar com as movimentações do mercado. Ela é composta por fundos de renda fixa, fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos;
Carteira Magnetis 5: é indicada para quem quer investir por mais tempo, tomando um pouco mais de risco em troca de uma rentabilidade maior. Em sua composição, ela tem investimentos em fundos de renda fixa, e uma parcela maior em “ativos de risco” tais como fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos.

Para fazer a alteração, você precisa preencher um termo de ciência de risco. Ele é uma declaração expressa de que você entende que a mudança de nível de risco te permite investir em produtos financeiros que não se enquadrariam na sua carteira caso você não solicitasse a mudança.
O termo de ciência de risco para mudança de perfil estará disponível em breve em nosso site e aplicativo.
É claro, a palavra final é sempre do cliente. Mas como o nosso papel é guiar você rumo aos melhores investimentos, também devemos te conscientizar para que você não tome decisões por impulso.
Se tiver qualquer dúvida, escreva para nossos especialistas no [email protected]

