As Carteiras Magnetis são montadas conforme a nossa estratégia de investimentos, que busca sempre o melhor retorno combinado com o menor risco para o seu perfil.
Para construí-las, monitoramos constantemente mais de 20 mil ativos no mercado financeiro e selecionamos as melhores opções para otimizar os seus resultados.
Quando você monta um plano de investimentos conosco, nosso sistema já recomenda a Carteira Magnetis ideal para você com base nas suas respostas. As opções são:

Carteira Magnetis 1: indicada para quem quer sair da poupança ou deseja um retorno mais previsível em suas aplicações financeiras. Ela é composta por uma ampla seleção de fundos de renda fixa investidos através do Magnetis Renda Fixa, Magnetis Debêntures Incentivadas e Magnetis Renda Fixa Simples;
Carteira Magnetis 2: é a opção para quem deseja aumentar sua rentabilidade sem abrir mão da previsibilidade da renda fixa. Ela é composta por cotas de fundos de renda fixa, além de uma pequena parcela em fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos;
Carteira Magnetis 3:é indicada para quem quer investir a partir de 2 anos, buscando mais rentabilidade. Ela tem uma composição balanceada em fundos de renda fixa, fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos;
Carteira Magnetis 4:é uma alternativa interessante para quem quer investir na bolsa de valores com diversificação, sem ter de se preocupar com as movimentações do mercado. Ela é composta por fundos de renda fixa, fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos;
Carteira Magnetis 5:é indicada para quem quer investir por mais tempo, tomando um pouco mais de risco em troca de uma rentabilidade maior. Em sua composição, ela tem investimentos em fundos de renda fixa, e uma parcela maior em “ativos de risco” tais como fundos multimercado, ações brasileiras, ações internacionais, estratégias de proteção e criptoativos.

Posso escolher os ativos financeiros que fazem parte da minha Carteira Magnetis?
Considerando que nós já varremos o mercado em busca das melhores aplicações para você e que sempre vamos respeitar o seu perfil de risco, não há necessidade de você escolher os ativos que fazem parte da sua carteira. Nós já temos um time especializado que faz isso para você!
Em alguns casos, é possível fazer pequenos ajustes para considerar uma eventual necessidade de liquidez ou para equilibrar a sua carteira considerando os investimentos que você tem fora da Magnetis.
Caso seja essa a sua demanda, converse com nossos especialistas no [email protected]. Vamos descobrir juntos uma solução para o seu caso!
Como os fundos Magnetis são compostos?
Aqui na Magnetis, adotamos uma estrutura de fundos de investimento próprios para aumentar a eficiência e a rentabilidade da sua carteira.
São três fundos exclusivos:

Magnetis Diversificação Renda Fixa: títulos de renda fixa e cotas de fundos dessa categoria;
Magnetis Diversificação Multimercado: cotas de fundos de investimento;
Magnetis Diversificação Ações: ETFs e cotas de fundos de ações.

Os custos desses fundos já estão inclusos na taxa de gestão.

aplicação inicial menor: é possível acessar os melhores investimentos do mercado a partir de R$ 1 mil;
diversificação completa a partir do primeiro investimento: com os fundos da Magnetis, a sua carteira já fica balanceada a partir da sua aplicação inicial. Sempre que você fizer uma aplicação adicional, os recursos já serão alocados nos percentuais ideais em cada ativo;
acesso a aplicações mais restritas: existem fundos de investimento que só permitem a entrada do chamado Investidor Qualificado. Essa é uma terminologia dos órgãos reguladores para definir quem tem acima de R$ 1 milhão para investir ou quem é profissional do mercado de investimentos. Com os fundos exclusivos da Magnetis, é possível investir em cotas dessas aplicações já no seu investimento inicial;
impostos recolhidos automaticamente:  você não precisa se preocupar com corretagem, emolumentos e nem com o recolhimento de guias de IR, as mudanças que ocorrem dentro de cada fundo não incorrem cobrança de imposto de renda para você (apenas quando você resgatar a cota do fundo de alocação em si é que o imposto de renda será cobrado);
mais agilidade e eficiência na gestão da sua carteira: Antes, clientes da Magnetis investiam diretamente em fundos de investimentos que recomendavámos, o que poderia gerar maior custo e burocracia no caso de solicitação de resgate de um fundo específico, por exemplo.

Outro grande diferencial dos nossos fundos é a devolução do rebate (cashback).
Por meio de negociações com nossos fornecedores, conseguimos obter certos descontos. Eles são 100% revertidos para nossos fundos, incrementando sua rentabilidade.

