Quando você faz uma aplicação na sua Carteira Magnetis, o dinheiro é distribuído de acordo com o seu plano de investimento.
Dessa forma, quer seja o seu primeiro investimento ou uma aplicação adicional, nosso sistema faz a alocação de acordo com a distribuição ideal para o seu perfil e para os objetivos definidos por você.
O valor aplicado pode ser distribuído entre os tipos de investimento a seguir. Os tipos de investimentos disponíveis e os percentuais de alocação variam conforme o nível de risco da sua carteira. Confira:

Fundo Magnetis Diversificação Renda Fixa;
Fundo Magnetis Diversificação Multimercado;
Ações Brasileiras;
Ações Internacionais;
Criptoativos;
Proteções.

No caso específico do investimento adicional, nosso sistema identifica o quanto sua carteira está distante da alocação ideal.
A partir daí, ele direciona os novos aportes para que seu portfólio volte ao equilíbrio ideal.
Lembramos que investimentos adicionais não são obrigatórios, mas são altamente recomendados para que sua carteira fique sempre atualizada.
Além disso, eles também permitirão que você atinja mais rápido as metas que você definiu no seu plano.
Em caso de qualquer dúvida, entre em contato conosco no e-mail [email protected]

